import React from "react";
import logoImg from "../../assests/images/logo.svg";
import landingImg from "../../assests/images/landing.svg";
import studyIcon from "../../assests/images/icons/study.svg";
import giveClassesIcon from "../../assests/images/icons/give-classes.svg";
import purleHeartIcon from "../../assests/images/icons/purple-heart.svg";
import { Link } from "react-router-dom";

import './styles.css';
import CoachList from "../CoachList";
import CoachForm from "../CoachForm";

function Landing() {
  return (
    <div id="page-landing">
       <div id="page-landing-content" className="container">
         <div className="logo-container">
          <img src={logoImg} alt="coach4me" />
          <h2>Encontre monitores online facilmente.</h2>
         </div>
        
         <img 
           src={landingImg} 
           alt="Plataforma de estudos" 
           className="coach-image" 
         /> 

        <div className="buttons-container">
          <Link to="/study" className="study">
            <img src={studyIcon} alt="Estudar" />
            Estudar
          </Link>
          
          <Link to="" className="give-classes">
            <img src={giveClassesIcon} alt="Dar aulas" />
            Dar aulas
          </Link>
        </div> 
        
        <span className="total-connections">
          Total de 1000 conexões já realizadas <img src={purleHeartIcon} alt="Coração Roxo" />
        </span>

       </div> 
    </div>
  ) 
}

export default Landing;
